import React from 'react';
import Button from '@material-ui/core/Button';
import DeleteOutlineOutlinedIcon from '@material-ui/icons/DeleteOutlineOutlined';

const Note = () =>{
    return (
        <>
            <div className="note">
                    <h2>Title Here</h2>
                    <p>Note here</p>
                    <Button >
                        <DeleteOutlineOutlinedIcon className="deleteBtn" />
                    </Button>
            </div>
        </>
    );
}

export default Note;
